import React from "react";
import { Navbar, Container } from "react-bootstrap";
import logo from "../Assets/imagixlogo.jpg";

const Login = () => {
  return (
    <div>
      <Navbar bg="dark">
        <Container>
          <Navbar.Brand style={{ color: "#FFF" }}>
            <img
              src={logo}
              width="30"
              height="30"
              className="d-inline-block align-top l-5"
              alt="Imagix Media Logo"
            />
            Imagix Media
          </Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  );
};

export default Login;
